import React from "react";
import '../CSS/Login.css';
import logo from '../Assets/logo.svg';


function Login() {
    return (
      <div className="login container-fluid">
        
        <img className="logo" src={logo} alt="logo"/>

        <div className="box-principale">
          <text className="ben-tornato">Resetta la tua Password</text>
          <text className="inserisci-credenziali">Inserisci la tua mail</text>
          <input className="input-inserisci-mail" type="username" placeholder="Inserisci la tua mail"></input>
          <button className="button-entra">Invia codice</button> 
        </div>

        <text className="password-dimenticata">Password dimenticata? <a className="reset" href="?">Resetta la Password</a></text>
 
      </div>
    );
  }
  

  export default Login;
